import React from 'react';
import { FaBriefcase, FaGraduationCap, FaHome, FaUser } from 'react-icons/fa';
import './Style.css';

function NavigationItems() {

    const getValueFromList = () => {
        var ul = document.getElementsByClassName("navigation");
        console.log(ul);
    }

    return (
        <ul className="navigation" id="nav_items">
            <li value="home"><FaHome size={32} color={"#2c4269"}/></li>
            <li value="aboutme"><FaUser size={32} color={"#2c4269"}/></li>
            <li value="education"><FaGraduationCap size={32} color={"#2c4269"}/></li>
            <li value="work"><FaBriefcase size={32} color={"#2c4269"}/></li>
        </ul>   
    );
}

export default NavigationItems;
